#define MAC_SET_UE_DRX_ACTIVE_TIME_START_TTI(dlUEContext_p, globalTTI)\
    dlUEContext_p->drxLastSavedTTI = globalTTI

#define MAC_DRX_UPDATE_UE_ACTIVE_TIME(dlUEContext_p, globalTTI)\
    if  (PNULL != gMacStats.pStats)\
    {\
        gMacStats.pStats->ueCommonInfoStats[dlUEContext_p->ueIndex].ueDRXStats.\
              currentActiveTimeofUeDRX += (globalTTI - dlUEContext_p->\
                  drxLastSavedTTI);\
    }\
       
#define MAC_DRX_UPDATE_LONG_CYCLE_ELAPSED(ueIndex, numDRXLongCycles)\
    if  (PNULL != gMacStats.pStats)\
    {\
        gMacStats.pStats->ueCommonInfoStats[ueIndex].ueDRXStats.\
                longDRXCyclesElapsed += numDRXLongCycles; \
    }
        
