/****************************************************************************
 *Function Name  : initDRXMgr
 *Inputs         : numOfCells -  Number of cells configured
 *Outputs        : None
 *Returns        : Void 
 *Description    : This function will initialize all the lists, queues used 
 *                 by the DRX manager. This function also creates the memory
 *                 pool for the DRX timers 
 ****************************************************************************/
/*CA Changes start  */
void initDRXMgr(UInt8 numOfCells)
/*CA Changes end  */
{
    UInt16       listIndex = 0;
    UInt8        cellCount = 0;
    UInt16 macMaxNumOfUeSupported = 0;
    /* Start 128 UE: Memory Changes */
    /* Initialize mempool. Since there shall be atmost one DRX timer running for
     * a UE. The mempool size shall be for maxNumOfUeSupported_g */
    for (cellCount = 0; cellCount < numOfCells; cellCount++) 
    {   macMaxNumOfUeSupported = cellSpecificParams_g.\
            cellConfigAndInitParams_p[cellCount]->initParams_p->macMaxNumOfUeSupported;
        createMemPool(sizeof(DRXTimerNode), (macMaxNumOfUeSupported));

        /* Create mempool for DL and UL scheduler events */
        createMemPool(sizeof(DRXEventTriggerNode), (macMaxNumOfUeSupported * 2));
        /* End 128 UE: Memory Changes */
    }
    /*CA Changes start  */
    createMemPool(sizeof(drxExpiryTimerList) * MAX_DRX_TIMER, numOfCells);
    for (cellCount = 0; cellCount < numOfCells; cellCount++)
    {
        GET_MEM_FROM_POOL(drxExpiryTimerList, drxExpiryTimerList_gp[cellCount],
                          sizeof(drxExpiryTimerList) * MAX_DRX_TIMER, PNULL);

        /*START : DRX_MAC_CE*/
        for (listIndex = 0; listIndex < MAX_DRX_TIMER; listIndex++)
        {
            listInit(&(drxExpiryTimerList_gp[cellCount] + listIndex)->expiryTimerList);
        }
        /*END   : DRX_MAC_CE*/
    }
    /*END   : DRX_MAC_CE*/

    /* initialize DRX DL and UL scheduler event queues */
    CONSTRUCT_AND_INIT_DRX_DL_SCHEDULER_EVENT_Q(numOfCells);
    CONSTRUCT_AND_INIT_DRX_UL_SCHEDULER_EVENT_Q(numOfCells);


/*SPR 23396 Start*/
    /*The below fucntion calls are takin too much of processing time as the loop iterations are very high
 * so the array initialisations have been moved to static at he beginning of this file under the SPR tag 23396*/
    /* Initialize StartTTIs of DRX short cycle and DRX long cycle */
#ifndef INIT_OPTIMIZATION
    initializeDRXShortCycleStartTTIMap();
    /* SPR 14954 Fix Start */
    initializeDRXLongCycleStartTTIMap();
#endif
/*SPR 23396 End*/
    /* SPR 14954 Fix End */
    LOG_MAC_MSG(MAC_MEAS_DRX_INITIALISATION_ID, LOGINFO,
            MAC_DRX, getCurrentTick(),DEFAULT_INT_VALUE,
            DEFAULT_INT_VALUE,DEFAULT_INT_VALUE,
            DEFAULT_INT_VALUE,DEFAULT_INT_VALUE,
            DEFAULT_FLOAT_VALUE,
            DEFAULT_FLOAT_VALUE,
            __func__,"DRX_INIT_SUCCESS");
    return;
}

/****************************************************************************
 *Function Name  : processDRXForUEs
 *Inputs         : globalTick - current global TTI in MAC 
 *                 internalCellIndex - Cell-Index at MAC
 *Outputs        : None
 *Returns        : Void 
 *Description    : This function is the DRX execution leg. It processes  
 *                 "UE scheduled" events from DL and UL schedulers. Also this 
 *                 this function call function to expire all DRX Times in this
 *                 globalTick 
 ****************************************************************************/
/* SPR 15909 fix start */
 void processDRXForUEs(tickType_t globalTick, InternalCellIndex internalCellIndex)
/* SPR 15909 fix end */
{
    /*CA Changes start  */
    if (drxConfiguredCount_g[internalCellIndex])
    /*CA Changes end  */
    {
        processDRXDLSchedulerEventQueue(internalCellIndex);
        processDRXULSchedulerEventQueue(internalCellIndex);
        expireAllDRXTimers(globalTick, internalCellIndex);
    }
}

/****************************************************************************
 * Function Name  : putEntryInDRXDLSchedulerEventQueue
 * Inputs         : ueIndex - UE Index,
 *                  globalTick - current global Tick in MAC 
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This will creates the drx event trigger queue node and 
 *                  push node to drxDLSchedulerEventQueue_g.
 ****************************************************************************/
/* SPR 15909 fix start */
 void putEntryInDRXDLSchedulerEventQueue(UInt16 ueIndex, tickType_t globalTick,
/* SPR 15909 fix end */        
                                               InternalCellIndex internalCellIndex) 
{
    DRXEventTriggerNode *drxEventTriggerNode_p = PNULL;

    GET_MEM_NODE_DRX_DL_SCHEDULER_EVENT_Q(drxEventTriggerNode_p, 
                            DRXEventTriggerNode);
    /*+COVERITY 5.3.0 - 24485*/
    if (PNULL == drxEventTriggerNode_p)
    {
        return;    
    }
    /*-COVERITY 5.3.0 - 24485*/
    drxEventTriggerNode_p->ueIndex = ueIndex;
    drxEventTriggerNode_p->globalTTI = globalTick;
    if(!(ENQUEUE_DRX_DL_SCHEDULER_EVENT_Q(DRXEventTriggerNode,
            (void *)&(drxEventTriggerNode_p->anchorNode), internalCellIndex)))
    {
        LOG_MAC_MSG(L2_PUSH_QUEUE_NODE_FAIL_ID,LOGWARNING,L2_SYS_FAIL,\
                getCurrentTick(),\
                __LINE__,0,0,0,0,\
                0.0,0.0,__FILE__,__func__);

        FREE_MEM_NODE_DRX_DL_SCHEDULER_EVENT_Q(drxEventTriggerNode_p);
    } 
    return;
}

