/****************************************************************************
 *Function Name  : initializeDRXShortCycleStartTTIMap
 *Inputs         : None
 *Outputs        : None
 *Returns        : Void 
 *Description    : This function will set the start onDurationTTI of the 
 *                 DRX short cycle for all the possible DRX configuration 
 ****************************************************************************/
/* + SPR 17439 */
void  initializeDRXShortCycleStartTTIMap(void)
/* - SPR 17439 */    
{
    UInt32 drxShortCycleIndex = 0;
    UInt32 drxStartOffset = 0;
    UInt32 sfn = 0;
    UInt32 sf = 0;
    UInt32 drxStartOffsetModShortcycle = 0;
    UInt8 flag = FALSE;

    for(drxShortCycleIndex = 0; 
            drxShortCycleIndex < MAX_DRX_SHORT_CYCLE_TIMER_LIST_SIZE; 
            drxShortCycleIndex++)
    {
        for(drxStartOffset = 0; drxStartOffset < MAX_DRX_START_OFFSET;
                 drxStartOffset++)
        {
            drxStartOffsetModShortcycle = drxStartOffset % 
                drxShortCycleTimerConfig_g[drxShortCycleIndex];

            for(sfn = 0; sfn < MAX_SFN_VALUE; sfn++) 
            {
                 for( sf = 0; sf < NUMBER_OF_SUBFRAME_IN_SYSTEM_FRAME; sf++) 
                 {
                 /* if this condition is satisfied the value will be stored 
                       in the array */
                    if((((sfn * 10) + sf) % (drxShortCycleTimerConfig_g
                        [drxShortCycleIndex])) == drxStartOffsetModShortcycle) 
                    {
                        drxShortCycleStartingTTI_g[drxShortCycleIndex]
                        [drxStartOffset] = ((sfn * 10 ) + sf) ;
                        flag = TRUE;
                        break;
                    }
                }
                if (TRUE == flag)
                {
                    flag = FALSE;
                    break;
                }
            }
        }
    }
    return;
}

