/****************************************************************************
 *Function Name  : deleteDRXConfig
 *Inputs         : dlUEContext_p - pointer to DL UE Context 
 *                 ulUEContext_p - pointer to UL UE Context     
 *                 internalCellIndex - Cell-Index at MAC
 *Outputs        : None
 *Returns        : void
 *Description    : This function deletes the DRX config of the UE. 
 *                 If any DRX timers are running, they will be stopped, The DRX
 *                 Context shall be reset
 ****************************************************************************/
void deleteDRXConfig(DLUEContext *dlUEContext_p, ULUEContext *ulUEContext_p,
                     /*CA Changes start  */
                     InternalCellIndex internalCellIndex)
                     /*CA Changes end  */
{
    DRXContext   *drxContext_p = &dlUEContext_p->drxContext;
    DRXSubState  drxSubState = drxContext_p->drxStateVariables.drxSubState;
    /* Rel9_upgrade_CR396 */
    ULDRXContext *ulDrxContext_p = &ulUEContext_p->ulDrxContext;
    /* Rel9_upgrade_CR396 */
    switch(drxSubState)
    {
        /*CA Changes start  */
        case DRX_ONDURATION_TIMER_RUNNING:
            
            stopDRXOnDurationTimer(drxContext_p, internalCellIndex);
            MAC_DRX_UPDATE_UE_ACTIVE_TIME(dlUEContext_p, getCurrentTick());
            
            break;

        case DRX_INACTIVITY_TIMER_RUNNING:
            
            stopDRXInactivityTimer(drxContext_p, internalCellIndex);
            MAC_DRX_UPDATE_UE_ACTIVE_TIME(dlUEContext_p, getCurrentTick());
            
            break;

        case DRX_SHORT_CYCLE_TIMER_RUNNING:
            
            stopDRXShortCycleTimer(drxContext_p, internalCellIndex);
            
            break;

        case DRX_LONG_CYCLE_TIMER_RUNNING:
            
            stopDRXLongCycleTimer(drxContext_p, internalCellIndex);
        /*CA Changes end  */
            
            break;
            
        default:
            /* Log Error */
            break;
    }

    freeMemPool((void *)drxContext_p->drxStateVariables.drxTimerNode_p);
    /*SPR 17055 Fix Start*/
    drxContext_p->drxStateVariables.drxTimerNode_p = PNULL;
    /*SPR 17055 Fix End*/
    /*START : DRX_MAC_CE*/
    if(drxContext_p->drxConfig.isdrxMacCeCmdConfigured)
    {
        freeMemPool((void *)drxContext_p->drxStateVariables.drxMacCeTimerNode_p);
        /*SPR 17055 Fix Start*/
        drxContext_p->drxStateVariables.drxMacCeTimerNode_p = PNULL; 
        /*SPR 17055 Fix End*/
    }
    /*END   : DRX_MAC_CE*/
    /*START : SPR 5400*/
    /*CA Changes start  */
    if (((DL_QOS_BASED_SCHEDULING == cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]->initParams_p->dlSchdConfig.dlSchedulerStrategy)||
         (UL_QOS_SCHEDULING == cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]->initParams_p->ulSchdConfig.ulSchedulerStrategy ))&&
        (drxContext_p->drxStateVariables.drxCurrentState == DRX_STATE_ON))
    {
        putEntryInDRXOnOffTriggerQueue(dlUEContext_p->ueIndex,                                                       
                        /*CA Changes start  */
                        DRX_ON_TO_DRX_OFF, getCurrentTick(), internalCellIndex); 
                        /*CA Changes end  */
    }
    /*CA Changes end  */
    /*END   : SPR 5400*/
    memSet(drxContext_p, 0, sizeof(DRXContext));
    dlUEContext_p->drxConfigType = RELEASE;
    ulUEContext_p->drxConfigType = RELEASE;
    ulUEContext_p->drxCurrentState = DRX_STATE_INVALID;
   
    /* Rel9_upgrade_CR396 */
    memSet(ulDrxContext_p, 0 ,sizeof(ULDRXContext));
    /* Rel9_upgrade_CR396 */
  
    LOG_MAC_MSG(MAC_DRX_DELETE_TIMERS_LOG_ID, LOGINFO,MAC_DRX, 
            getCurrentTick(),dlUEContext_p->ueIndex,
            dlUEContext_p->drxConfigType, ulUEContext_p->drxConfigType,
            DEFAULT_INT_VALUE,DEFAULT_INT_VALUE,
            DEFAULT_FLOAT_VALUE,DEFAULT_FLOAT_VALUE,
            __func__,"DRX_TIMER_DELETION_SUCCESS");

    /*CA Changes start  */
    if (drxConfiguredCount_g[internalCellIndex])
        drxConfiguredCount_g[internalCellIndex]--;
    /*CA Changes end  */

    /* + SPS_TDD_Changes */
    memSet(dlUEContext_p->spsDlInfo.ueDrxTTI, 
            DRX_STATE_INVALID, MAX_SPS_INTERVAL );
#ifdef FDD_CONFIG
    memSet(ulUEContext_p->spsUlInfo.ueDrxTTI, 
            DRX_STATE_INVALID, MAX_SPS_INTERVAL );
#elif TDD_CONFIG
    memSet(ulUEContext_p->spsUlInfo.ueDrxTTI, 
            DRX_STATE_INVALID, MAX_UL_SPS_INTERVAL );
#endif
    /* - SPS_TDD_Changes */

    return;
}

