/****************************************************************************
 * Function Name  : drxMacCeTimerExpiry
 * Inputs         : dlUEContext_p - Pointer to DL UE context,
 *                  globalTick - global Tick in MAC 
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will process the drxMacCeTimer Expiry 
 *                  event as per DRX state machine.
 ****************************************************************************/
/* SPR 15909 fix start */
void drxMacCeTimerExpiry(DLUEContext *dlUEContext_p, tickType_t globalTick        
        ,InternalCellIndex internalCellIndex)
{
    tickType_t          nextNearestOnDurationTTI = 0;    
    /* SPR 15909 fix end */
    /*Coverity 94810_94715_94844_94873 Fix Start*/
    tickType_t              numDRXShortCyclesExpired = 0;
    tickType_t              numDRXLongCyclesExpired = 0;
    tickType_t              drxShortCycleTimer = 0;
    tickType_t              drxLongCycleTimer = 0;
    /* SPR 15909 fix start */
    tickType_t          drxShortCycleNextOnDurationTTI = 0;
    tickType_t          drxLongCycleNextOnDurationTTI = 0;
    /* SPR 15909 fix end */
    tickType_t              numDRXShortCycleTicksExpired = 0;
    tickType_t              numDRXLongCycleTicksExpired = 0;
    /*Coverity 94810_94715_94844_94873 Fix End*/
    DRXContext          *drxContext_p = &(dlUEContext_p->drxContext);
    DRXStateVariables   *drxStateVariables_p = &(drxContext_p->
                                                    drxStateVariables);
    DRXState            drxCurrentState = drxStateVariables_p->drxCurrentState;
    DRXConfig           *drxConfig_p = &(drxContext_p->drxConfig);
    ULUEContext         *ulUEContext_p  = PNULL;  
    ULUEContextInfo     *ulUEContextInfo_p = PNULL;
  
    drxShortCycleTimer = drxConfig_p->shortDRXCycle;
    drxLongCycleTimer = drxConfig_p->longDRXCycle;
    ulUEContextInfo_p = &ulUECtxInfoArr_g[dlUEContext_p->ueIndex]; 
    ulUEContext_p = ulUEContextInfo_p->ulUEContext_p;  
    /*START : 5352*/
    LOG_MAC_MSG(MAC_DRX_EVENT_TRIGGERED_LOG_ID, LOGDEBUG, MAC_DRX,
                getCurrentTick(), dlUEContext_p->ueIndex, 
                DRX_EVENT_MAC_CE_TIMER_EXPIRED, drxCurrentState, 
                drxStateVariables_p->drxSubState, drxStateVariables_p->
                drxNextCycle, DEFAULT_FLOAT_VALUE, 
                DEFAULT_FLOAT_VALUE,__func__,""); 
    /*START : 5352*/
    switch(drxCurrentState)  
    {
        case DRX_STATE_OFF:
            if(drxContext_p->drxStateVariables.drxSubState == DRX_ONDURATION_TIMER_RUNNING)
            {
                /*CA Changes start  */
                stopDRXOnDurationTimer(drxContext_p, internalCellIndex);
                /*CA Changes end  */
            }
            else if(drxContext_p->drxStateVariables.drxSubState == DRX_INACTIVITY_TIMER_RUNNING)
            {
                /*CA Changes start  */
                stopDRXInactivityTimer(drxContext_p, internalCellIndex);
                /*CA Changes end  */
            }
            if (globalTick >= drxStateVariables_p->drxLongCycleNextOnDurationTTI)
            {
                /* Calculate the number of TTIs expired since last DRX Long 
                   Cycle */
                numDRXLongCycleTicksExpired = (globalTick - drxStateVariables_p->
                        drxLongCycleNextOnDurationTTI);

                /* Calculate the number of DRX Short cycles expired */
                numDRXLongCyclesExpired = numDRXLongCycleTicksExpired /
                    drxLongCycleTimer;

                /* Calculate the next OnDurationTTI > Inactivity Timer expiry
                 * i.e globalTick for Long DRX cycle */
                drxLongCycleNextOnDurationTTI = drxStateVariables_p->
                    drxLongCycleNextOnDurationTTI + 
                    (numDRXLongCyclesExpired * drxLongCycleTimer) +
                    drxLongCycleTimer;

                drxStateVariables_p->drxLongCycleNextOnDurationTTI = 
                    drxLongCycleNextOnDurationTTI;

                LOG_MAC_MSG(MAC_DRX_NEXT_ONDURATION_TTI_CAL_LOG_ID, LOGDEBUG, 
                        MAC_DRX, getCurrentTick(), DRX_LONG_CYCLE, 
                        numDRXLongCycleTicksExpired, numDRXLongCyclesExpired, 
                        drxLongCycleNextOnDurationTTI, DEFAULT_INT_VALUE,
                        DEFAULT_FLOAT_VALUE, DEFAULT_FLOAT_VALUE,
                        __func__,"");

                MAC_DRX_UPDATE_LONG_CYCLE_ELAPSED(dlUEContext_p->ueIndex,
                        numDRXLongCyclesExpired);
            }   
            else
            {
                drxLongCycleNextOnDurationTTI = drxStateVariables_p->
                    drxLongCycleNextOnDurationTTI;
            }
            
            if (drxConfig_p->isDRXShortCycleConfigured)
            {
                if (globalTick >= drxStateVariables_p->
                        drxShortCycleNextOnDurationTTI)
                {
                    /* Calculate the number of TTIs expired since last DRX Short 
                       Cycle */
                    numDRXShortCycleTicksExpired = (globalTick - 
                            drxStateVariables_p->drxShortCycleNextOnDurationTTI);

                    /* Calculate the number of DRX Short cycles expired */
                    numDRXShortCyclesExpired = numDRXShortCycleTicksExpired /
                        drxShortCycleTimer;

                    /* Calculate the next OnDurationTTI > Inactivity Timer expiry
                     * i.e globalTick for short DRX cycle */
                    drxShortCycleNextOnDurationTTI = drxStateVariables_p->
                        drxShortCycleNextOnDurationTTI + 
                        (numDRXShortCyclesExpired * drxShortCycleTimer) +
                        drxShortCycleTimer; 

                    drxStateVariables_p->drxShortCycleNextOnDurationTTI = 
                        drxShortCycleNextOnDurationTTI;

                    LOG_MAC_MSG(MAC_DRX_NEXT_ONDURATION_TTI_CAL_LOG_ID, LOGDEBUG, 
                            MAC_DRX, getCurrentTick(), DRX_SHORT_CYCLE, 
                            numDRXShortCycleTicksExpired, 
                            numDRXShortCyclesExpired, 
                            drxShortCycleNextOnDurationTTI, DEFAULT_INT_VALUE,
                            DEFAULT_FLOAT_VALUE, DEFAULT_FLOAT_VALUE,
                            __func__,"");

                }
                else
                {
                    drxShortCycleNextOnDurationTTI =
                        drxStateVariables_p->drxShortCycleNextOnDurationTTI; 
                }

                /* Run the left over drx short/Long cycle timer */
                if(drxStateVariables_p->drxNumShortCyclesElapsed < 
                       drxContext_p->drxConfig.drxShortCycleTimer)
                {
                    /* Set the next nearest onDurationTTI and next cycle */
                    nextNearestOnDurationTTI = drxShortCycleNextOnDurationTTI;
                    /*Start Short Duration Cycle*/ 
                    startDRXShortCycleTimer(dlUEContext_p, 
                        drxShortCycleNextOnDurationTTI, internalCellIndex);
                    /*Set the DRX current SubState */
                    SET_UE_DRX_SUB_STATE(drxContext_p, 
                        DRX_SHORT_CYCLE_TIMER_RUNNING);
                }else
                {
                    nextNearestOnDurationTTI = drxLongCycleNextOnDurationTTI; 
                    drxStateVariables_p->drxNumShortCyclesElapsed = 0;
                    startDRXLongCycleTimer(dlUEContext_p,drxLongCycleNextOnDurationTTI
                            ,internalCellIndex);                    
                    /* Set the DRX current SubState */
                    SET_UE_DRX_SUB_STATE(drxContext_p, 
                        DRX_LONG_CYCLE_TIMER_RUNNING);
                    
                }
                /* Send the DRX_OFF_TO_DRX_On trigger to DL and 
                   UL strategy */
                putEntryInDRXOnOffTriggerQueue(dlUEContext_p->ueIndex, 
                        /*CA Changes start  */
                        DRX_OFF_TO_DRX_ON, nextNearestOnDurationTTI, internalCellIndex);
                        /*CA Changes end  */

                SET_UE_DRX_STATE(drxContext_p, ulUEContext_p, 
                        DRX_STATE_ON);
            }
            else
            {
                nextNearestOnDurationTTI = drxLongCycleNextOnDurationTTI; 
                SET_UE_DRX_NEXT_CYCLE(drxContext_p, DRX_LONG_CYCLE);
                /* Run the left over drx long cycle timer */
                startDRXLongCycleTimer(dlUEContext_p, 
                        drxLongCycleNextOnDurationTTI
                        ,internalCellIndex);

                /* Send the DRX_OFF_TO_DRX_ON trigger to DL and 
                   UL strategy */
                putEntryInDRXOnOffTriggerQueue(dlUEContext_p->ueIndex, 
                        /*CA Changes start  */
                        DRX_OFF_TO_DRX_ON, nextNearestOnDurationTTI, internalCellIndex);
                        /*CA Changes end  */

                /* Set the DRX current SubState and DRX state */
                SET_UE_DRX_SUB_STATE(drxContext_p, 
                        DRX_LONG_CYCLE_TIMER_RUNNING);

                SET_UE_DRX_STATE(drxContext_p, ulUEContext_p, 
                       DRX_STATE_ON);

            }
            break;
            
        case DRX_STATE_ON:
        case DRX_STATE_INVALID:
            LOG_MAC_MSG(MAC_DRX_INVALID_EVENT_LOG_ID, LOGERROR, MAC_DRX,
                    getCurrentTick(), DRX_EVENT_MAC_CE_TIMER_EXPIRED, 
                    drxCurrentState, DEFAULT_INT_VALUE, DEFAULT_INT_VALUE, 
                    DEFAULT_INT_VALUE, DEFAULT_FLOAT_VALUE, DEFAULT_FLOAT_VALUE,
                    __func__,"");
            break;
    }
    LOG_MAC_MSG(MAC_DRX_EVENT_HANDLED_LOG_ID, LOGDEBUG, MAC_DRX,
                getCurrentTick(), drxStateVariables_p->drxCurrentState, 
                drxStateVariables_p->drxSubState,
                drxStateVariables_p->drxNextCycle, drxStateVariables_p->
                drxShortCycleNextOnDurationTTI, drxStateVariables_p->
                drxLongCycleNextOnDurationTTI, DEFAULT_FLOAT_VALUE, 
                DEFAULT_FLOAT_VALUE,__func__,""); 
    return;
}

/*****************************************************************************
 *Function Name  : expireAllDRXTimers
 *Inputs         : globalTick - current global tick in MAC
 *                 internalCellIndex - Cell-Index at MAC
 *Outputs        : None
 *Returns        : Void
 *Description    : This function will call expiry functions for all DRX timer.
 *                 This function intern calls functions which expires DRX
 *                 inactivity timer, onDuration timer, short cycle timer and
 *                 long cycle timer 
 ****************************************************************************/
/* SPR 15909 fix start */
 void expireAllDRXTimers(tickType_t globalTick,
/* SPR 15909 fix end */        
                               /*CA Changes start */
                               InternalCellIndex internalCellIndex)
                               /*CA Changes end */
{
    DRXTimerNode *drxTimerNode_p           = PNULL;
    DRXTimerNode *drxTimerNode_temp        = PNULL;
    UInt16       expiryIndex               = 0;
    UInt16       expiryDiff                = 0;
    UInt16       count                     = 0;
    DLUEContext  *dlueContext_p            = PNULL;
    DRXContext   *drxContext_p             = PNULL;
    /*coverity-530 CID-32294*/
    DRXSubState  drxSubState_temp          = DRX_SUB_STATE_INVALID;
    /*coverity-530 CID-32294*/
    DRXStateVariables *drxStateVariables_p = PNULL;
    ULUEContext  *ulueContext_p            = PNULL;
    ULUEContextInfo *ulueCntxtInfo_p       = PNULL;
    /*SPS_DRX_CHANGE*/
    UInt16       newExpiryIndex            = 0;
    /* SPR 15909 fix start */
    tickType_t   newExpiryTTI              = 0;
    /* SPR 15909 fix end */
    /*SPS_DRX_CHANGE*/
    /*START_DRX_OPT*/
    /* SPR 15909 fix start */
    tickType_t   advLastScheduledTick = 0;
    /* SPR 15909 fix end */
    /*END_DRX_OPT*/

    expiryIndex  = globalTick & MAX_DRX_TIMER_MOD_VALUE;
    /*CA Changes start  */
    count        = listCount(&(drxExpiryTimerList_gp[internalCellIndex] + expiryIndex)->expiryTimerList);    
    /*CA Changes end  */

    if (count)
    {
        /*CA Changes start  */
        drxTimerNode_p = (DRXTimerNode *)getListNode(
               &(drxExpiryTimerList_gp[internalCellIndex] + expiryIndex)->expiryTimerList, 0);
        /*CA Changes end  */

        while(drxTimerNode_p &&
              (drxTimerNode_p->expiryTTI == globalTick))
        {
            dlueContext_p       = drxTimerNode_p->ueContext_p;
            ulueCntxtInfo_p     = &ulUECtxInfoArr_g[dlueContext_p->ueIndex];
            ulueContext_p       = ulueCntxtInfo_p->ulUEContext_p;
            drxContext_p        = &dlueContext_p->drxContext;
            drxSubState_temp    = drxContext_p->drxStateVariables.drxSubState;
            drxStateVariables_p = &drxContext_p->drxStateVariables;

            if(drxTimerNode_p->drxTimerNodeType == DRX_MAC_CE_TIMER)
            {
                /* + SPR 22243 Fix*/
                dlueContext_p->drxFlag = FALSE; 
                /* - SPR 22243 Fix*/
                drxTimerNode_temp = drxStateVariables_p->drxTimerNode_p;

                /*CA Changes start  */
                listDeleteNode(&(drxExpiryTimerList_gp[internalCellIndex] + expiryIndex)->expiryTimerList,
                            (LTE_LIST_NODE *)drxTimerNode_p);
                /*CA Changes end  */
                /*START : 5352*/
                LOG_MAC_MSG(MAC_DRX_EVENT_TRIGGERED_LOG_ID, LOGDEBUG, MAC_DRX,
                    getCurrentTick(), dlueContext_p->ueIndex, 
                    DRX_EVENT_MAC_CE_TIMER_EXPIRED, drxStateVariables_p->drxCurrentState, 
                    drxStateVariables_p->drxSubState, 
                    DEFAULT_FLOAT_VALUE,DEFAULT_FLOAT_VALUE, 
                    DEFAULT_FLOAT_VALUE,__func__,""); 
                /*END   : 5352*/
                drxContext_p->drxStateVariables.isDrxMacCeTimerRunning = FALSE;
                expiryDiff = drxTimerNode_temp->expiryTTI - drxTimerNode_p->expiryTTI;
                /*START_DRX_OPT*/
                /*START:6172*/
                //if(dlueContext_p->lastScheduledTick >= (ulueContext_p->lastScheduledTick + PHY_DL_DELAY))
                if(dlueContext_p->advlastScheduledTick >= ulueContext_p->advlastScheduledTick)
                /*END:6172*/
                {
                    /*START:6172*/
                    advLastScheduledTick = dlueContext_p->advlastScheduledTick;
                    /*END:6172*/
                }
                else
                {
                    /*START:6172*/
                    advLastScheduledTick = ulueContext_p->advlastScheduledTick;
                    /*END:6172*/
                }
 
                if((advLastScheduledTick <= drxTimerNode_p->expiryTTI)
                                      &&(advLastScheduledTick > drxStateVariables_p->drxStartTTIOfMacCeTimer))   
                {
                    /*Basically restart the MacCeTimer*/   
                     startDRXMacCeTimer(dlueContext_p,advLastScheduledTick, internalCellIndex);   
                }else
                {
                /*END_DRX_OPT*/
                    if(expiryDiff>=drxContext_p->drxConfig.drxMacCeCmdThreshold &&
                       (dlueContext_p->ueQueueLoad == 0)&&
                       (ulueContext_p->bsrNetTotal == 0))
                    {
                        /*SPS_DRX_CHANGE*/
                        if(globalTick >= drxContext_p->drxStateVariables.drxLastOnDurationTTI &&
                           (globalTick < (drxContext_p->drxStateVariables.drxLastOnDurationTTI
                                         + drxContext_p->drxConfig.drxOnDurationTimer))&&
                           (drxSubState_temp == DRX_INACTIVITY_TIMER_RUNNING)&&
                           /*START : DRX_COMMAND_FIX*/
                           (dlueContext_p->nonGbrSPSLcCount > 0))
                           /*END   : DRX_COMMAND_FIX*/
                        {
                            /*I will calculate the newExpiryIndex newExpiryTTI Basically restart the 
                              MacCeTimer*/
                            newExpiryTTI   = drxContext_p->drxStateVariables.drxLastOnDurationTTI +
                                                    drxContext_p->drxConfig.drxOnDurationTimer;
                            newExpiryIndex = newExpiryTTI & MAX_DRX_TIMER_MOD_VALUE;
                            drxTimerNode_p->expiryTTI = newExpiryTTI;
                            drxStateVariables_p->drxMacCeTimerExpiryIndex = newExpiryIndex;
                            /*CA Changes start  */
                            listInsertNode(&(drxExpiryTimerList_gp[internalCellIndex] + newExpiryIndex)->expiryTimerList,
                                (LTE_LIST_NODE *)drxTimerNode_p);
                            /*CA Changes end  */
                        }else
                        {
                            /*Put the entry into the queue*/ 
                            updateDRXInDLUEContext(dlueContext_p->ueIndex,internalCellIndex);
                            drxStateVariables_p->isMacCeToBeScheduled = TRUE;
                            /* + SPR 22243 Fix*/
                            /* This flag will be set as true when conditions to trigger DRX MAC CE is satisifed,
                             * and a new DRX node is inserted in DRX queue. This should be reset at encoder after
                             * successful scheduling. 
                             * */
                            dlueContext_p->drxFlag = TRUE; 
                            /* - SPR 22243 Fix*/
                        }
                    }
                /*START_DRX_OPT*/
                }
                /*END_DRX_OPT*/
            }

            if (drxTimerNode_p->drxTimerNodeType == DRX_CYCLE_TIMER)
            {

                /*CA Changes start  */
                listDeleteNode(&(drxExpiryTimerList_gp[internalCellIndex] + expiryIndex)->expiryTimerList,
                            (LTE_LIST_NODE *)drxTimerNode_p);
                /*CA Changes end  */

                switch(drxSubState_temp)
                {
                    case DRX_ONDURATION_TIMER_RUNNING :
                        drxOnDurationTimerExpiry(drxTimerNode_p->ueContext_p,
                             drxTimerNode_p->expiryTTI, internalCellIndex);                      
                        break;
                    case DRX_SHORT_CYCLE_TIMER_RUNNING:
                        drxShortCycleTimerExpiry(drxTimerNode_p->ueContext_p,
                            drxTimerNode_p->expiryTTI, internalCellIndex);
                        break;
                    case DRX_LONG_CYCLE_TIMER_RUNNING:
                        drxLongCycleTimerExpiry(drxTimerNode_p->ueContext_p,
                            drxTimerNode_p->expiryTTI,
                            internalCellIndex);
                        break;
                    case DRX_INACTIVITY_TIMER_RUNNING:
                        drxInactivityTimerExpiry(drxTimerNode_p->ueContext_p, 
                            globalTick, internalCellIndex);
                        break;
                    default :
                        /* Log Error */
                        break;
                }
            }
            /*Get the next node*/
            /*CA Changes start  */
            drxTimerNode_p = (DRXTimerNode *)getListNode(
                       &(drxExpiryTimerList_gp[internalCellIndex] + expiryIndex)->expiryTimerList, 0);
            /*CA Changes end  */
        }
    }

    return;
}

