/*****************************************************************************
 * Function Name  : cleanupDRXQueue
 * Inputs         : internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will cleanup the DRX Queue.
 ****************************************************************************/
void cleanupDRXQueue(InternalCellIndex internalCellIndex)
{
    UInt32 count =0;
    UInt32 i =0;
    DRXEventTriggerNode *drxEventTriggerNode_p = PNULL;
    count = COUNT_DRX_DL_SCHEDULER_EVENT_Q(internalCellIndex);

    for (i = 0; i < count; i++)
    {
        DEQUEUE_DRX_DL_SCHEDULER_EVENT_Q(DRXEventTriggerNode ,(void **)&drxEventTriggerNode_p, internalCellIndex);

        if (drxEventTriggerNode_p)
        {
            FREE_MEM_NODE_DRX_DL_SCHEDULER_EVENT_Q(drxEventTriggerNode_p);
            drxEventTriggerNode_p = PNULL;
        }
    }
    count = COUNT_DRX_UL_SCHEDULER_EVENT_Q(internalCellIndex);

    for (i = 0; i < count; i++)
    {
        DEQUEUE_DRX_UL_SCHEDULER_EVENT_Q(DRXEventTriggerNode ,(void **)&drxEventTriggerNode_p, internalCellIndex);

        if (drxEventTriggerNode_p)
        {
            FREE_MEM_NODE_DRX_UL_SCHEDULER_EVENT_Q(drxEventTriggerNode_p);
            drxEventTriggerNode_p = PNULL;
        }
    }


}

/*****************************************************************************
 * Function Name  : deInitDRXQueue
 * Inputs         : internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will un-initialize the DRX Queue.
 ****************************************************************************/
void deInitDRXQueue(InternalCellIndex internalCellIndex)
{
    if ( PNULL != drxDLSchedulerEventQueue_gp[internalCellIndex] )
    {
        circQDeInit(drxDLSchedulerEventQueue_gp[internalCellIndex]);
        freeMemPool(drxDLSchedulerEventQueue_gp[internalCellIndex]);
        drxDLSchedulerEventQueue_gp[internalCellIndex] = PNULL;
    }
    else
    {
        ltePanic("drxDLSchedulerEventQueue_gp is NULL");
    }
    if ( PNULL != drxULSchedulerEventQueue_gp[internalCellIndex] )
    {
        circQDeInit(drxULSchedulerEventQueue_gp[internalCellIndex]);
        freeMemPool(drxULSchedulerEventQueue_gp[internalCellIndex]);
        drxULSchedulerEventQueue_gp[internalCellIndex] = PNULL;
    }
    else
    {
        ltePanic("drxULSchedulerEventQueue_gp is NULL");
    }
}

/*****************************************************************************
 * Function Name  : cleanupDRXQueue
 * Inputs         : internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will cleanup and un-initialize the DRX Queue.
 ****************************************************************************/
void cleanAndDeInitDRXQueue(InternalCellIndex internalCellIndex)
{
    cleanupDRXQueue(internalCellIndex);
    deInitDRXQueue(internalCellIndex);
}
